import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Loading from './components/Loading'; 
import Home from './components/Login'; 
import Presentation from './components/Presentation'; 
import LogProv from './components/LogProv'; // 
import LogCom from './components/LogCom'; // 
import Final from './components/Final'; // 

function App() {
  return (
    <Router>
      <Switch>
        {/* Rutas */}
        <Route exact path="/" component={Loading} /> {/* Ruta para la página de carga (Loading) */}
        <Route path="/login" component={Home} /> {/* Ruta para la página de inicio de sesión (Login) */}
        <Route path="/presentation" component={Presentation} /> {/* Ruta para la página de presentación (Presentation) */}
        <Route path="/logprov" component={LogProv} /> {/* Ruta para el formulario de proveedores (LogProv) */}
        <Route path="/logcom" component={LogCom} /> {/* Ruta para el formulario de comerciantes (LogCom) */}
        <Route path="/final" component={Final} /> {/* Ruta para la página final (Final) */}
      </Switch>
    </Router>
  );
}

export default App;
